import '../Styles/flies.css'

function Flies({flies}) {
    return (
        <div>
            <header>Flies</header>
            <div className='fly-grid'>
                {flies.map((fly)=> {
                    return(
                        <div key={fly.id} className="fly-card">
                            <h2>{fly.name}</h2>
                            <img src={fly.image} />
                            <h3>Target Species: {fly.species_name}</h3>
                        </div>
                    )
                })}
            </div>
        </div>    
    )
}

export default Flies;
